export class GetDataUser {
  constructor() {
    this.userData = null;
    this.error = null;
  }

  async getData() {
    const response = await fetch('https://aff8-197-149-28-14.eu.ngrok.io/user/', {
      credentials: 'include'
    });

    if (!response.ok) {
      this.error = 'Une erreur est survenue lors de la requête.';
      return;
    }

    const data = await response.json();
    this.userData = data;
  }

  getUserData() {
    return this.userData;
  }
}
